$(document).ready(function () {
    $("#consultar").click(function () {
        if ($('#casillaSearch').val().trim() != ""){
            var categoria = $('#categoria');
            if (categoria.val()==="codigo"){
                busquedaCodigo($('#casillaSearch').val());
            }
            if (categoria.val()==="serie"){
                busquedaSerie($('#casillaSearch').val());
            }
        }
    });
    /*TODO falta completar la busqueda por serie de recibo*/
    function busquedaSerie(busqueda) {
        $.ajax({
            type: "GET",
            url: 'https://api.jsonbin.io/b/5eed4a4f2406353b2e08f5f3/6',//url_servicios+"agremiados/?filter[where][codigocolegiado]="+busqueda,
            data: "json",
            beforeSend: ()=>{
                $('.bi-search').hide();
                $('.bi-arrow-repeat').show();
            },
            success: function (response) {
                $('.bi-search').show();
                $('.bi-arrow-repeat').hide();
                for (let responseElement of response) {
                    if (responseElement.nColegiado == parseInt(busqueda)){
                        let pdf = 'data:application/pdf;base64,';
                        $('#section-pdf').html('<embed src="'+pdf+'" type="application/pdf"/>');
                        break;
                    }else {
                        $('#section-pdf').html("No se encontro nada...");
                    }
                }
            }
        });
    }
    function busquedaCodigo(busqueda) {
        $.ajax({
            type: "GET",
            url: 'https://api.jsonbin.io/b/5eed4a4f2406353b2e08f5f3/6',//url_servicios+"agremiados/?filter[where][codigocolegiado]="+busqueda,
            data: "json",
            beforeSend: ()=>{
                $('.bi-search').hide();
                $('.bi-arrow-repeat').show();
            },
            success: function (response) {
                $('.bi-search').show();
                $('.bi-arrow-repeat').hide();
                for (let responseElement of response) {
                    if (responseElement.nColegiado == parseInt(busqueda)){
                        let pdf = 'data:application/pdf;base64,';
                        $('#section-pdf').html('<embed src="'+pdf+'" type="application/pdf"/>');
                        break;
                    }else {
                        $('#section-pdf').html("No se encontro nada...");
                    }
                }

            }
        });
    }

    /*=============================*/
    /*=====VALIDANDO CASILLAS======*/
    $('#content').validate({
        rules: {
            casillaSearch: {
                required: true
            }
        },
        messages: {
            casillaSearch: {
                required: "Ingrese Búsqueda"
            }
        }
    });
});